window.bookSummaryJSON = "<p>The Rocky Mountain Pack’s territory has always been her sanctuary. The one place where she was safe from those who track her, their pursuit merciless and unrelenting.</p> <p>But when Naya is taken from her very home, that refuge is violated. She’s exposed. </p> <p>There’s nowhere safe for her now. And her enemy is far more terrible than she ever imagined. An immortal, the woman can’t be killed. She’s lived a thousand years already. </p> <p>Naya is determined to find a way to end the immortal where none has been found before. She is a warrior. She’s trained her entire life to defeat the hunters.</p> <p>With the fiercely protective pack beta Bruno at her side, and a group of motley friends behind her, she has a chance.</p> <p>She won’t waste it. One shot is all she needs...</p> <p><b>The Rocky Mountain Pack series is gritty, sexy, and action-packed urban fantasy paranormal shifter romance.</b></p> <p><b><i>Wolf Honor</i></b><b> is a full-length novel recommended for mature listeners due to language, sexual situations, and graphic fighting scenes.</b></p>"; 
